import React from "react";
import NavBar from "./navbar";
import { useLocation } from 'react-router-dom';
import { businesses } from './apiService';

function Events() {
  const location = useLocation();
  const data = location.state?.data;

  // Extract the first item from the data.businesses array
  const firstEvent = data?.businesses[0];

  return (
    <div>
      <NavBar />
      <div>
        {/* Render the first event elsewhere */}
        {firstEvent && (
          <div>
            <h2>First Event:</h2>
            <p>{JSON.stringify(firstEvent)}</p>
          </div>
        )}

        {/* Render the list of events */}
        {data ? (
          <div>
            <ul>
              {data.businesses.map((item, index) => (
                <li key={index}>{JSON.stringify(item)}</li>
              ))}
            </ul>
          </div>
        ) : (
          <div>Loading...</div>
        )}
      </div>
    </div>
  );
}

export default Events;
